CREATE TABLE IF NOT EXISTS sections (section_id INT,department VARCHAR(50) NOT NULL,course_code VARCHAR(8) NOT NULL,course_name VARCHAR NOT NULL,section VARCHAR(8) NOT NULL,sem VARCHAR(8) NOT NULL,status VARCHAR(32) NOT NULL,faculty VARCHAR(128) NOT NULL,location VARCHAR(32) NOT NULL,available INT NOT NULL,capacity INT NOT NULL,credits VARCHAR(8) NOT NULL,academic_level VARCHAR(128) NOT NULL,PRIMARY KEY (section_id, sem));

CREATE INDEX IF NOT EXISTS idx_section_search ON sections(department, course_code, course_name, section, sem, faculty);

CREATE TABLE IF NOT EXISTS meetings (meeting_id SERIAL PRIMARY KEY,section_id INT NOT NULL,sem VARCHAR(8) NOT NULL,meeting_type VARCHAR(32) NOT NULL,meeting_day VARCHAR(32) NOT NULL,start_time TIME,end_time TIME,building VARCHAR(128) NOT NULL,room VARCHAR(64) NOT NULL,exam_date DATE);

CREATE TABLE IF NOT EXISTS semesters (sem VARCHAR(10) NOT NULL PRIMARY KEY, semester_name VARCHAR(20) NOT NULL);

















































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































